define('text!views/auth/login.html', ['module'], function(module) { module.exports = "<template>\n    <div slot=\"content\">\n        <div class=\"login-background\"><img src=\"/images/background.jpg\"></div>\n\n        <div class=\"login-container\">\n            <form class=\"au-animate\" novalidate=\"novalidate\" ref=\"loginForm\" submit.delegate=\"handleFormSubmission()\">\n                <div class=\"form-group form-group-default\">\n                    <h3>Login</h3><br>\n                    <div class=\"row\" if.bind=\"foundAvatar\">\n                        <div class=\"col-sm-6\">\n                            <img src.bind=\"foundAvatar\" class=\"img-fluid img-thumbnail\">\n                            <br>\n                            <br>\n                        </div>\n                    </div>\n                    <div class=\"controls\">\n                        <input type=\"text\" name=\"username\" placeholder=\"Username\" class=\"form-control\" required=\"\" aria-required=\"true\" aria-invalid=\"false\" value.bind=\"username\" blur.trigger=\"findUserAvatar()\">\n                    </div>\n                </div>\n\n                <div class=\"form-group form-group-default\">\n                    <div class=\"controls\">\n                        <input type=\"password\" class=\"form-control\" name=\"password\" placeholder=\"Password\" required=\"\" aria-required=\"true\" aria-invalid=\"false\" value.bind=\"password\">\n                    </div>\n                </div>\n\n                <div class=\"row\">\n                    <div class=\"col-sm-12\">\n                        <div class=\"checkbox \">\n                            <input type=\"checkbox\" value=\"1\" id=\"rememberme\">\n                            <label for=\"rememberme\">Keep me logged in</label>\n                        </div>\n                    </div>\n                </div>\n\n                <button class=\"btn btn-primary\" type=\"submit\">Login</button>\n            </form>\n        </div>\n    </div>\n</template>\n"; });
define('text!views/dashboard/home.html', ['module'], function(module) { module.exports = "<template>\n    <div slot=\"content\">\n        <h1>Admin Dashboard</h1>\n        <table class=\"table table-striped table-hover\">\n            <thead class=\"thead-inverse\">\n                <tr>\n                <th>#</th>\n                <th>Name</th>\n                <th>Email</th>\n                <th>Username</th>\n                </tr>\n            </thead>\n            <tbody>\n                <tr repeat.for=\"user of users\">\n                    <th scope=\"row\">${user.id}</th>\n                    <td>${user.name}</td>\n                    <td>${user.email}</td>\n                    <td>${user.username}</td>\n                </tr>\n            </tbody>\n        </table>\n    </div>\n</template>\n"; });
define('text!views/layouts/auth.html', ['module'], function(module) { module.exports = "<template>\n    <slot name=\"content\"></slot>\n</template>\n"; });
define('text!views/layouts/default.html', ['module'], function(module) { module.exports = "<template>\n    <require from=\"../partials/navbar.html\"></require>\n\n    <style type=\"text/css\">body { padding-top: 65px; }</style>\n\n    <navbar router.bind=\"router\" user.bind=\"user\"></navbar>\n\n    <div class=\"container-fluid\">\n        <slot name=\"content\"></slot>\n    </div>\n</template>\n"; });
define('text!views/partials/navbar.html', ['module'], function(module) { module.exports = "<template bindable=\"router, user\">\n    <nav class=\"navbar navbar-dark bg-primary navbar-fixed-top\" role=\"navigation\">\n        <button class=\"navbar-toggler hidden-lg-up\" type=\"button\" data-toggle=\"collapse\" data-target=\"#navbarcollapse\" aria-controls=\"navbarcollapse\" aria-expanded=\"false\" aria-label=\"Toggle navigation\"></button>\n\n        <div class=\"collapse navbar-toggleable-md\" id=\"navbarcollapse\">\n            <a class=\"navbar-brand\" href=\"#\">\n                <i class=\"fa fa-home\"></i>\n                <span>${router.title}</span>\n            </a>\n            <ul class=\"nav navbar-nav\">\n                <li repeat.for=\"row of router.navigation\" class=\"nav-item ${row.isActive ? 'active' : ''}\"><a class=\"nav-link\" href.bind=\"row.href\">${row.title}</a></li>\n            </ul>\n\n            <ul class=\"nav navbar-nav navbar-right\">\n                <li show.bind=\"user.loggedIn\"><a click.delegate=\"user.logout()\">Logout</a></li>\n                <li class=\"loader\" if.bind=\"router.isNavigating\"><i class=\"fa fa-spinner fa-spin fa-2x\"></i></li>\n            </ul>\n        </div>\n    </nav>\n</template>\n"; });
define('text!views/dashboard/users/list.html', ['module'], function(module) { module.exports = "<template>\n    <div slot=\"content\">\n        <h2>Manage Users</h2>\n        <table class=\"table table-striped table-hover\">\n            <thead class=\"thead-inverse\">\n                <tr>\n                <th>#</th>\n                <th>Name</th>\n                <th>Email</th>\n                <th>Username</th>\n                </tr>\n            </thead>\n            <tbody>\n                <tr repeat.for=\"user of users\">\n                    <th scope=\"row\"><a route-href=\"route: usersView; params.bind: {id: user.id}\">${user.id}</a></th>\n                    <td><a route-href=\"route: usersView; params.bind: {id: user.id}\">${user.name}</a></td>\n                    <td><a route-href=\"route: usersView; params.bind: {id: user.id}\">${user.email}</a></td>\n                    <td><a route-href=\"route: usersView; params.bind: {id: user.id}\">${user.username}</a></td>\n                </tr>\n            </tbody>\n        </table>\n    </div>\n</template>\n"; });
define('text!views/dashboard/users/view.html', ['module'], function(module) { module.exports = "<template>\n    <div class=\"container\" slot=\"content\">\n        <div class=\"row\">\n            <div class=\"col-sm-6\">\n                <div class=\"card\">\n                    <div class=\"card-img-block\">\n                        <img class=\"card-img-top\" src.bind=\"user.image\" alt=\"${user.name}\">\n                        <label class=\"avatar-change\" for=\"avatarUpload\" show.bind=\"editMode\"><i class=\"fa fa-camera\" aria-hidden=\"true\"></i></label>\n                        <input type=\"file\" id=\"avatarUpload\" style=\"display:none;\" files.bind=\"currentUserFile\">\n                    </div>\n                    <div class=\"card-block\">\n                        <h4 class=\"card-title\">${user.name}</h4>\n                        <p>${user.email}</p>\n                    </div>\n                    <ul class=\"list-group list-group-flush\">\n                        <li class=\"list-group-item\"><strong>ID</strong><br>${user.id}</li>\n                        <li class=\"list-group-item\"><strong>Username</strong><br><span show.bind=\"!editMode\">${user.username}</span><input type=\"text\" class=\"form-control\" value.bind=\"user.username\" show.bind=\"editMode\"></li>\n                        <li class=\"list-group-item\"><strong>Email</strong><br><span show.bind=\"!editMode\">${user.email}</span><input type=\"text\" class=\"form-control\" value.bind=\"user.email\" show.bind=\"editMode\"></li>\n                    </ul>\n                    <div class=\"card-block\">\n                        <a href=\"#\" click.delegate=\"saveUser(user)\" class=\"card-link btn btn-primary\" if.bind=\"editMode\">Save changes</a>\n                        <a href=\"#\" click.delegate=\"toggleEditMode()\" class=\"card-link\">${editMode ? 'Cancel user edit' : 'Edit user'}</a>\n                        <a href=\"#\" click.delegate=\"deleteUser()\" class=\"card-link\">Delete user</a>\n                    </div>\n                </div>\n            </div>\n        </div>\n        <div class=\"modal fade\" id=\"deleteUserModal\" tabindex=\"-1\" role=\"dialog\" aria-labelledby=\"deleteUserModal\" aria-hidden=\"true\">\n  <div class=\"modal-dialog\" role=\"document\">\n    <div class=\"modal-content\">\n      <div class=\"modal-header\">\n        <button type=\"button\" class=\"close\" data-dismiss=\"modal\" aria-label=\"Close\">\n          <span aria-hidden=\"true\">&times;</span>\n        </button>\n        <h4 class=\"modal-title\" id=\"myModalLabel\">Are you sure you want to delete user: ${user.name}?</h4>\n      </div>\n      <div class=\"modal-footer\">\n        <button type=\"button\" class=\"btn btn-secondary\" data-dismiss=\"modal\">Cancel</button>\n        <button type=\"button\" class=\"btn btn-primary\" click.delegate=\"deleteUserConfirm()\">Yes</button>\n      </div>\n    </div>\n  </div>\n</div>\n    </div>\n\n</template>\n"; });
